export class About extends React.Component {

render() {


    return (
        <>
        <div className="header-7">hi</div>
        <div>{this.props.data.company_description}</div>
        <Spacer amount={10} />
        <h4 style={{fontStyle:'italics'}}>Ratings</h4>
